import React from 'react';
import './App.css';
import Header from './Header';

function App() {
    return (
        <div className="App">
            <Header />
            <section id="about">
                <h2>Sobre mí</h2>
                <p>Hola, soy un desarrollador frontend...</p>
            </section>
            <section id="projects">
                <h2>Proyectos</h2>
                <p>Aquí van mis proyectos...</p>
            </section>
         <section id="skills">
               <h2>Habilidades</h2>
                  <p>Mis habilidades incluyen HTML, CSS, JavaScript, React, etc.</p>
        </section>

            <section id="contact">
                 <h2>Contacto</h2>
                 <p>Si quieres saber más, contáctame a través del formulario o en mis redes sociales.</p>
            </section>
        </div>
    );
}

export default App;
